import React from "react";
import Row from 'common/components/Row';
import Col from 'common/components/Col';
import FormControl from "common/components/FormControl";
import TextInput from "common/components/TextInput";
import ErrorMessage from "common/components/ErrorMessage";

const UserInfo = ({formProps: { register, errors }}) => {
    return (
        <Row>
            <Col>
                <FormControl>
                    <TextInput name="firstName" ref={register} placeholder="First name" error="?errors.firstName"/>
                    {errors.firstName && <ErrorMessage error="errors.firstName">{errors.firstName.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <TextInput name="lastName" ref={register} placeholder="Last name"/>
                    {errors.lastName && <ErrorMessage>{errors.lastName.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <TextInput name="nickname" ref={register} placeholder="Nickname"/>
                    {errors.nickname && <ErrorMessage>{errors.nickname.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <TextInput name="email" ref={register} placeholder="Email address"/>
                    {errors.email && <ErrorMessage>{errors.email.message}</ErrorMessage>}
                </FormControl>
            </Col>
            <Col>
                <FormControl>
                    <TextInput name="phoneNumber" ref={register} placeholder="Phone number"/>
                    {errors.phoneNumber && <ErrorMessage>{errors.phoneNumber.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <TextInput name="conDisease" ref={register} placeholder="Congenital disease"/>
                    {errors.conDisease && <ErrorMessage>{errors.conDisease.message}</ErrorMessage>}
                </FormControl>
                <FormControl>
                    <TextInput name="allergicFood" ref={register} placeholder="Allergic food"/>
                    {errors.allergicFood && <ErrorMessage>{errors.allergicFood.message}</ErrorMessage>}
                </FormControl>
            </Col>
        </Row>
    )
}

export default UserInfo;
